import React from "react";

const Button = ({ children, ...rest }) => {
  return (
    <button
      className="bg-purple-normal w-full rounded-full flex items-center justify-center px-4 py-2 text-white hover:bg-purple-dark transition-all"
      {...rest}
    >
      {children}
    </button>
  );
};

export default Button;
